import React from "react";
import { Link} from "react-router-dom";

function Register(){
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
  
    function handleEmailChange(e) {
      setEmail(e.target.value);
    }
  
    function handlePasswordChange(e) {
      setPassword(e.target.value)
    }
    return(
        <div className="login">
        <h1 className="login__title">Регистрация</h1>

        <form className="input__form">
            <input className="login__input " placeholder="Email"></input>
            <input className="login__input " placeholder="Пароль"></input>
            <button className="login__button">Зарегистрироваться</button>           
            <p className="login__link">Уже зарегистрированы?<Link to="/sign-in" className="login__link"> Войти </Link></p>
        </form>
    </div>
    )
}
export default Register
